// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0;
pragma experimental ABIEncoderV2;

import "./User.sol";
import "./UserInfo.sol";
import "./Product.sol";

contract Transporter {
    User user;

    constructor(address _userAddress) {
        user = User(_userAddress);
    }

    modifier onlyTransporter() {
        require(user.getUserRole(msg.sender) == 4, "OTCC");
        _;
    }

    //Hold all the product batches initiated for shipment by transporter to deliver at retailer store
    mapping(address => address[]) public RetailerTaggedProductBatchList;

    //Event to capture & dispatch updated product detalils after shipment initiated
    event UpdatedProductBatchShipmentStatusEvt(
        address indexed productId,
        uint256 status
    );

    //Method to cancel package shipment
    //@param _productId Address product id
    function cancelInitiatedPackageShipment(
        address _productId,
        string memory _reason
    ) public onlyTransporter {
        // bool result = Product(_productId).cancelPackageShipment(_reason);
        if (Product(_productId).cancelPackageShipment(_reason)) {
            //Dispatching event
            emit UpdatedProductBatchShipmentStatusEvt(
                _productId,
                Product(_productId).getProductBatchStatus()
            );
        }
    }

    //Load product batch from sender & deliver to associated receiver (Dist-retailer)
    //@param _productId Product batch Id
    //@param _receiver Retailer store
    function loadProductBatchForShipmentToRetailer(
        address _productId,
        address _receiver
    ) public onlyTransporter {
        if (Product(_productId).initiateProductBatchForShipment()) {
            //Capture all the product batches which are initiated for shipment
            RetailerTaggedProductBatchList[_receiver].push(_productId);
            //dispatching event
            emit UpdatedProductBatchShipmentStatusEvt(
                _productId,
                Product(_productId).getProductBatchStatus()
            );
        }
    }

    //deliver to associated receiver & update status (Dist-Retailer)
    //@param _productId Product batch Id
    function productBatchDeliveredToRetailer(address _productId)
        public
        onlyTransporter
    {
        if (Product(_productId).updateProductBatchStatusToDeliver()) {
            //dispatching event
            emit UpdatedProductBatchShipmentStatusEvt(
                _productId,
                Product(_productId).getProductBatchStatus()
            );
        }
    }

    //get list of product batches initiated for transfer by distributor to transporter
    function getRetailerAssignedProductBatches(address _retailer)
        public
        view
        returns (address[] memory)
    {
        return RetailerTaggedProductBatchList[_retailer];
    }
}
